import React from 'react';
import TabItem from './TabItem';


const Tab = () => {
 return (
 <div style={{
   display:"flex",
   justfyContent: "space-evenly",
   width:"100vw",
   height:"70px",
   background:"black",
   position:"absolute",
   bottom:"0",
   color:"red"

 }}
 >
   <TabItem/>
   <TabItem/>
   <TabItem/>
     
 </div>  
 );  
};

export default Tab;
